pragma solidity 0.8.4;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";

import "../interfaces/IStrategy1155.sol";
import "../interfaces/IStrategyERC20.sol";
import "../interfaces/IProxyCloneFactory.sol";

import "../core/Controlled.sol";
import "../core/ModuleMapConsumer.sol";

contract Strategy1155 is Initializable, ModuleMapConsumer, Controlled, IStrategy1155 {
    bytes4 constant BALANCE_OF = IStrategyERC20.balanceOf.selector;
    bytes4 constant TOTAL_SUPPLY = IStrategyERC20.totalSupply.selector;
    bytes4 constant MINT = IStrategyERC20.mint.selector;
    bytes4 constant BURN = IStrategyERC20.burn.selector;

    bytes constant TOTAL_SUPPLY_ENCODED = abi.encodePacked(TOTAL_SUPPLY); // We can store it already encoded because totalSupply() has no arguments

    IProxyCloneFactory ProxyCloneFactory;

    // strategy id => underlying strategy token address
    mapping(uint256 => address) public override idToUnderlying;
    // strategy id => StrategyERC20 address
    mapping(uint256 => address) public idToERC20;

    function initialize(
        address[] calldata controllers_,
        address _moduleMap,
        address _ProxyCloneFactory,
        address _initialStrategyToken,
        uint256 _initialStrategyTokenId,
        address _initialStrategyUnderlying
    ) external initializer {
        __Controlled_init(controllers_, _moduleMap);
        ProxyCloneFactory = IProxyCloneFactory(_ProxyCloneFactory);

        idToERC20[_initialStrategyTokenId] = _initialStrategyToken;
        idToUnderlying[_initialStrategyTokenId] = _initialStrategyUnderlying;
    }

    /**
     *
     * ERC20 creation
     *
     **/

    function deployStrategyToken(
        string memory _strategyName,
        uint256 _strategyId,
        address _underlying
    ) public override onlyController {
        _deployStrategyToken(_strategyName, _strategyId, _underlying);
    }

    function _deployStrategyToken(
        string memory _strategyName,
        uint256 _strategyId,
        address _underlying
    ) internal {
        idToERC20[_strategyId] = _deployStrategyToken(_strategyName, _strategyId);
        idToUnderlying[_strategyId] = _underlying;
    }

    function _deployStrategyToken(string memory _strategyName, uint256 _strategyId)
        internal
        returns (address tokenAddress)
    {
        string memory name = string(abi.encodePacked(_strategyName, " Strategy Token"));
        string memory symbol = string(abi.encodePacked("0x", _strategyName));
        tokenAddress = ProxyCloneFactory.deployClone(
            0x9d0b6d0ad79fa832c2082e69387fafe9828decc4d2a4b44c042cc70d8df667cc, // keccak256("StrategyERC20")
            abi.encode(name, symbol, _strategyId, asSingletonArray(address(this)), address(moduleMap))
        );
    }

    /**
     *
     * "ERC1155"
     *
     **/

    function mint(
        address _account,
        uint256 _id,
        uint256 _amount
    ) public override onlyController {
        callERC20(_id, abi.encodePacked(MINT, uint256(uint160(_account)), _amount));
    }

    function burn(
        address _account,
        uint256 _id,
        uint256 _amount
    ) external override onlyController {
        callERC20(_id, abi.encodePacked(BURN, uint256(uint160(_account)), _amount));
    }

    /**
     *
     * Getters
     *
     **/

    function balanceOf(address _account, uint256 _id) public view override returns (uint256 balance_) {
        bytes memory data = staticCallERC20(_id, abi.encodePacked(BALANCE_OF, uint256(uint160(_account))));
        assembly {
            balance_ := mload(add(data, 0x20))
        }
    }

    function balanceOfBatch(address _account, uint256[] calldata _ids)
        external
        view
        override
        returns (uint256 totalBalance_)
    {
        for (uint256 i; i < _ids.length; i++) {
            totalBalance_ += balanceOf(_account, _ids[i]);
        }
    }

    function totalSupply(uint256 _id) public view override returns (uint256 supply_) {
        bytes memory data = staticCallERC20(_id, TOTAL_SUPPLY_ENCODED);
        assembly {
            supply_ := mload(add(data, 0x20))
        }
    }

    function totalSupplyBatch(uint256[] calldata _ids) public view override returns (uint256 totalSupply_) {
        for (uint256 i; i < _ids.length; i++) {
            totalSupply_ += totalSupply(_ids[i]);
        }
    }

    /**
     *
     * Help functions
     *
     **/

    function asSingletonArray(address element) internal pure returns (address[] memory) {
        address[] memory array = new address[](1);
        array[0] = element;

        return array;
    }

    function callERC20(uint256 _id, bytes memory _data) internal returns (bytes memory data) {
        bool success;
        (success, data) = getERC20(_id).call(_data);
        require(success, "Strategy1155 low-level ERC20 call failed");
    }

    function staticCallERC20(uint256 _id, bytes memory _data) internal view returns (bytes memory data) {
        bool success;
        (success, data) = getERC20(_id).staticcall(_data);
        require(success, "Strategy1155 low-level ERC20 staticcall failed");
    }

    function getERC20(uint256 _id) internal view returns (address erc20_) {
        erc20_ = idToERC20[_id];
        require(erc20_ != address(0), "Strategy1155 erc20 for _id don't exist");
    }

    /**
     *
     * migration
     *
     **/

    function migrateDeploy(
        string[] calldata _names,
        uint256[] calldata _ids,
        address[] calldata _underlyings
    ) external onlyManager {
        for (uint256 i; i < _names.length; i++) {
            if (idToERC20[_ids[i]] == address(0)) {
                _deployStrategyToken(_names[i], _ids[i], _underlyings[i]);
            }
        }
    }
}
